import {
  CONTACT_ACTION,
  FINANCIAL_ACTION,
  BUSINESS_ACTION,
} from "./actionTypes";

export default function submitContactAction(firstName, lastName, email) {
  return {
    type: CONTACT_ACTION,
    payload: {
      firstName: firstName,
      lastName: lastName,
      contactEmail: email,
    },
  };
}

